export function HomeDinamica() {
  return (
    <Container>
      <Header />
      <Search />

      <h1>oi</h1>
    </Container>
  );
}

export const Container = styled.div`
  background: #f4fdff;
  #nav-1 li a {
    color: #ffae10;
  }
  #nav-2 a {
    color: #ffae10;
  }
  .search-div input {
    background: #fff;
